import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../Header';


function Home() {
  document.title="Home Page"
  return (
    <div>
      <Container fluid className="pr-0 pl-0">
        <Header />
        <div id="front-image">
        </div>
      </Container>
      <Row>
        <Col md={6} sm={12}>
        <Row>
          <Col md={6} sm={12}>
            <p className="float-right mr-0">Hi, I'm Anshor</p>
          </Col>
          <Col>
          </Col>
        </Row>
        </Col>
        <Col>
        </Col>
      </Row>

    </div>
  );
}

export default Home;
